import { useEffect, useState } from 'react'

const Home = () => {

    useEffect(() => {
        const fetchUsers = async () => {
            const res = await fetch('hhtp://localhost:4000/api/users')
            const json = await res.json()
        }

        fetchUsers()
    }, [])

    return(
        <div className="Home">
            <h2>Home</h2>
        </div>
    )
}

export default Home
